ads.description:
Na sprzedaż Seat Toledo z niskim przebiegiem 173 tys. km. Jestem jego drugim właścicielem od połowy 2013 r. Auto zakupione w polskim salonie, służyło jako drugie. Niski przebieg wynika z faktu długich przestojów (praca poza granicami kraju). W 2013 r. została założona instalacja LPG (przy przebiegu 75 tys. km) oraz hak. Auto z końcówki produkcji, stąd bogate wyposażenie, jak na wersję Stella. Auto posiada klimatyzację automatyczną, elektryczne szyby (wszystkie), lusterka sterowane i składane elektrycznie, poduszki powietrzne oraz kurtyny bezpieczeństwa w oparciach siedzeń, centralny zamek sterowany pilotem, alufelgi fabryczne Seat, radio fabryczne AURA, czujnik parkowania tył. Auto nie brało udziału w zdarzeniach drogowych, poza wymianą tylnego zderzaka jeszcze na gwarancji. Wszystkie szyby oryginalne. Przegląd do lipca 2025 r., OC do grudnia. Aktualnie doinwestowane:
- w 2023 r. wymiana butli gazowej (koniec homologacji poprzedniej);
- wymiana filtrów gazowych oraz świec zapłonowych i cewek;
- w połowie 2023 r. wymiana tarczy hamulcowych przednich oraz klocków (tylne wymienione wcześniej);
- wymiana osprzętu rozrządu (czerwiec 2023);
- w połowie 2024 r. pełen serwis klimatyzacji - wymiana środka chłodniczego oraz wentylatora pierwszego obiegu.
Auto posiada kilka defektów powłoki lakierniczej (na zdjęciach), z których najważniejszy to ślady korozji na lewym, przednim błotniku. Poza tym, brak jakichkolwiek problemów z korozją - podłoga absolutnie zdrowa (auto z konserwacją fabryczną). Obecnie trzeba przymierzać się do serwisu olejowego oraz czyszczenia wtrysków gazu.
Zapraszam (pośrednikom dziękuję)
